svg.script:
document.addEventListener("DOMContentLoaded", function(event) {

	var params = document.defaultView.frameElement.getElementsByTagName("param")[0].value;

    var linecardTitleSlot = localStorage.getItem('linetitleMOD').split(/[()]/);

    var linecardPid = localStorage.getItem('linepidMOD').split(",");

    var arrayPosition = [];
    var j=0;

    for(var i=1; i<linecardTitleSlot.length; i+=2){
    	arrayPosition.push([linecardTitleSlot[i], linecardPid[j]]);
    	j++;
    }

    for(var i=0; i<arrayPosition.length; i++){
    	for(var j=0; j<arrayPosition[i].length; j++){
    		if(arrayPosition[i][0] === params + "-1"){
    			document.getElementById('Linecard1').setAttribute('data', arrayPosition[i][1] + '.svg');
	        	document.getElementById('fore1').style.display = "block";
	        	document.getElementById('s1').setAttribute('value', params + "-1");

    		}else if(arrayPosition[i][0] === params + "-2"){
    			document.getElementById('Linecard2').setAttribute('data', arrayPosition[i][1] + '.svg');
	        	document.getElementById('fore2').style.display = "block";
	        	document.getElementById('s2').setAttribute('value', params + "-2");

    		}
    	}
    }

});
